      not calculating the Federal portion of the expenditure.  This has been corrected.  Every
      effort is made to accurately and timely report to the FEC.'
  expected_count: 5
  input: TEXT,F3XA,,"Amendment addresses FEC letter dated March 23, 2007.  Each of
    the four bullet points are addressed, in their own order.  Due to the nature of
    elections during the current cycle, the SCDP accurately reported all applicable
    salaries or wages on Schedule B supporting line 30(b) for the time period referred
    to in the letter from the FEC.  Likewise, all applicable taxes and fringe benefits
    are treated accurately for this reporting period.  Payments for fringe benefits
    and taxes for these employees are properly disclosed on Schedule B supporting
    line 30(b).  The Schedule H4 expenditures for party campaign planning and compliance
    and treasury services are not for party employees.  The providers of these services
    act as consultants.  The payment to Schirmer, Craig for 'consulting - party campaign
    planning' has been moved to Schedule B line 30(b) to more accurately report the
    nature of the consulting work performed due to isolated areas where a candidate
    for Federal office appeared on the ballot.  The payment to Huttleston for Voter
    File maintenance was inadvertently not calculating the Federal portion of the
    expenditure.  This has been corrected.  Every effort is made to accurately and
    timely report to the FEC."
